import { Component, OnInit } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';
import { FileService } from '../../core/services/file.service';
import { AuthService } from '../../core/services/auth.service';

@Component({
  selector: 'app-prof-dashboard',
  standalone: true,
  imports: [CommonModule, FormsModule],
  templateUrl: './prof-dashboard.component.html',
  styleUrls: ['./prof-dashboard.component.scss']
})
export class ProfDashboardComponent implements OnInit {
  files: any[] = [];
  title = '';
  type = 0;
  selectedFile: File | null = null;
  slug = '';

  uploading = false;
  deletingId: number | null = null;

  constructor(private fileService: FileService, private auth: AuthService) {}

  ngOnInit() {
    this.slug = this.auth.getProfSlugFromToken();
    this.loadFiles();
  }

  onFileSelected(e: any) { this.selectedFile = e.target.files[0]; }

  onUpload() {
    if (!this.selectedFile || !this.title) return;
    this.uploading = true;
    this.fileService.uploadFile(this.title, this.type, this.selectedFile).subscribe({
      next: () => { this.title=''; this.type=0; this.selectedFile=null; this.loadFiles(); },
      complete: () => this.uploading = false
    });
  }

  loadFiles() {
    if (!this.slug) return;
    this.fileService.getFilesByProf(this.slug).subscribe(res => this.files = res);
  }

  delete(id: number) {
    this.deletingId = id;
    this.fileService.deleteFile(id).subscribe({
      next: () => this.loadFiles(),
      complete: () => this.deletingId = null
    });
  }
}
<div class="row g-4">
  <div class="col-12 col-lg-5">
    <div class="card p-4">
      <h3 class="mb-3">Ajouter une ressource</h3>
      <form (ngSubmit)="onUpload()">
        <div class="mb-3">
          <label class="form-label">Titre</label>
          <input class="form-control" [(ngModel)]="title" name="title" required>
        </div>
        <div class="mb-3">
          <label class="form-label">Type</label>
          <select class="form-select" [(ngModel)]="type" name="type">
            <option [value]="0">Cours</option>
<option [value]="1">TD</option>
            <option [value]="2">TP</option>
            <option [value]="3">Autre</option>
          </select>
        </div>
        <div class="mb-3">
          <label class="form-label">Fichier</label>
          <input type="file" class="form-control" (change)="onFileSelected($event)">
        </div>
        <button class="btn btn-primary w-100" [disabled]="uploading">
          {{ uploading ? 'Upload...' : 'Uploader' }}
        </button>
      </form>
    </div>
  </div>

  <div class="col-12 col-lg-7">
    <div class="d-flex justify-content-between align-items-center mb-2">
      <h3 class="m-0">Mes fichiers</h3>
      <button class="btn btn-outline-primary" (click)="loadFiles()">Rafraîchir</button>
    </div>
    <div class="row g-3">
      <div class="col-12" *ngIf="!files.length">
        <div class="alert alert-info">Aucun fichier pour l’instant.</div>
      </div>
      <div class="col-12 col-md-6" *ngFor="let f of files">
        <div class="card p-3 h-100">
          <div class="d-flex justify-content-between align-items-start">
            <div>
              <div class="fw-bold">{{ f.title }}</div>
              <small class="text-muted">Type: {{ f.type }}</small>
            </div>
            <button class="btn btn-sm btn-outline-danger" (click)="delete(f.id)" [disabled]="deletingId===f.id">
              Supprimer
            </button>
          </div>
          <a class="mt-2 btn btn-sm btn-primary" [href]="f.url" target="_blank">Télécharger</a>
        </div>
      </div>
    </div>
  </div>
</div>
